import React, { Component } from 'react'
import axios from 'axios'



class MenuItem extends Component {
  state = {
    menu_items:[]
  }

  render() {
    return (
      <div>MENU_ITEM - {this.props.data}</div>
    )
  }
}

export default MenuItem
